        "revisionreason": "SUMMARY OF REQUESTED PLAN CORRECTIONS\n(Clyde Ford – 958 E. Windsor Cir., Fresno, CA)\n\n1. Contractor Information Missing\n\n\nReviewer requires full contractor information, including:\n\n\nCompany name (Rebel Energy Systems LLC)\n\nCSLB License Number\n\nLicense classification\n\nContact information\n\nBusiness license (if required by AHJ)\n\n\n\nFix: Add full contractor block to PV-0 and all titleblocks.\n\n\n\n2. Battery / ESS Clearance Corrections\n\n\nReviewer flagged:\n\n\nMissing actual measured distance from the Powerwall 3 units and expansion units to the property line.\n\nCity requires minimum 3 ft clearance from property line and from doors/windows.\n\n\n\nFix:\n\n\nAdd dimensioned distances on the site plan.\n\nRedraw location if required to maintain 3 ft.\n\n\n\n3. Battery Separation Requirements\n\n\nReviewer notes reference the required spacing per Fire Code:\n\n\n3 ft separation between each ESS unit\n\n3 ft from openings (doors, windows, vents, HVAC)\n\n\n\nFix: Update S-2 and PV-1 with exact measured spacing and ensure code notes reference CRC R327 / CFC 1206.2.10.\n\n\n\n4. Rapid Shutdown / Pathway Identification\n\n\nReviewer marked that:\n\n\nPathways, roof access, and fire setbacks must comply with Fresno Fire / CFC 1205.2.1–1205.3.3.\n\n\n\nFix:\n\n\nClarify setback dimensions.\n\nLabel roof access point with required clearance.\n\n\n\n5. Provide Actual Equipment Distances\n\n\nNotes require:\n\n\nActual measured distances from batteries, equipment, and conduit runs to relevant building features, property lines, or openings.\n\n\n\nFix: Add dimension callouts on PV-1 and S-2.\n\n\n\n6. Interconnection Method Confirmation\n\n\nReviewer flagged:\n\n\n“Feed-through lugs” interconnection is listed, but the existing MSP and expansion room must be shown clearly.\n\n\n\nFix:\n\n\nAdd photo sheet or elevation verifying MSP has feed-through lugs or show alternate method.\n\nEnsure OCPD logic matches 705.12(B).\n\n\n\n7. Clarify Roof Attachment Locations\n\n\nRed marks request:\n\n\nAttachment points and layout must be field-verified and shown clearly.\n\nSome locations may conflict with obstructions.\n\n\n\nFix:\n\n\nClean up PV-2 with more accurate rafter/joist layout and permitted tolerances.\n\n\n\n8. Structural Notes / Loading Confirmation\n\n\nReviewer flagged:\n\n\nStructural load calcs need full verification.\n\nEnsure references comply with CBC 2022.\n\n\n\nFix:\n\n\nConfirm PV load (2.52 psf) appears on S-1.\n\nEnsure tile roof structural detail meets local code.\n\n\n\n9. Labeling / Placards\n\n\nReviewer noted:\n\n\nAll placards required by 2022 CEC must be included and correctly located.\n\n\n\nFix:\n\n\nAdd missing RSS label location if not shown.\n\nEnsure PV AC Disconnect placard is present if required by Fresno.\n\n\n\n10. General Plan Clean-Up\n\n\nReviewer requested:\n\n\nRemove duplicated or outdated notes\n\nRemove unnecessary equipment or conflicting callouts\n\nMake sure all sheets reference the same equipment counts\n\nEnsure all titleblocks match\n\n\n\nFix:\n\n\nSync all sheets PV-0 through E-2.\n\nVerify BOM on PV-3 matches electrical design.\n\n\n\n\n\n\n\nDefy the ordinary,\n\n\n\nRyan Gutierrez\n\nRebel Energy Systems\n\nCSLB: 1141943\n\n(559) 972-6920\n\nwww.rebelenergysystems.com\n\n“Their Rules. Your Bill. Our Rebellion.”\n\n One attachment\n  •  Scanned by Gmail Security Sandbox\n",
