        "systemkwac": null,
        "revisionreason": "Hello,\n  Tesla has made the following revision requests for this plan set:\n\nPer the Powerwall 3 Datasheet, Powerwall 3 meets Rapid Shutdown Device Compliance by utilizing an initiation method of either an External System Shutdown Switch (E-Stop button), or the Powerwall 3 Enable Switch on the side of the unit. If the E-stop button is used as RSD compliance method, then every single Powerwall 3 unit needs to be wired directly to the E-stop button. The E-stop button is not run to the Gateway device. Please update the design so the E-stop is wired to both Powerwall 3 units.\n\n \n\nWe observe that there are no MCI’s called out on the PV DC wiring for the Powerwall 3. Powerwall 3 requires MCI’s to operate properly and to meet Rapid Shutdown Device compliance. MCI’s are still required for the Powerwall 3 even if the AHJ/Utility is not enforcing rapid shutdown device compliance. We recommend reviewing the guidance provided in the following documents to assist with determining the quantity of MCI’s that will be required.  ",
