        "governingcodes": "1. WHERE ALL TERMINALS OF THE\nDISCONNECTING MEANS MAY BE\nENERGIZED IN THE OPEN POSITION, A\nSIGN WILL BE PROVIDED WARNING OF\nTHE HAZARDS PER ART. 690.17.\n2. EACH UNGROUNDED CONDUCTOR OF THE\nMULTIWIRE BRANCH CIRCUIT WILL BE\nIDENTIFIED BY PHASE AND SYSTEM PER\nART. 210.5.\n3. A NATIONALLY-RECOGNIZED TESTING\nLABORATORY SHALL LIST ALL EQUIPMENT\nIN COMPLIANCE WITH ART. 110.3.\n4. CIRCUITS OVER 250V TO GROUND SHALL\nCOMPLY WITH ART. 250.97, 250.92(B)\n5. DC CONDUCTORS EITHER DO NOT ENTER\nBUILDING OR ARE RUN IN METALLIC\nRACEWAYS OR ENCLOSURES TO THE\nFIRST ACCESSIBLE DC DISCONNECTING\nMEANS PER ART. 690.31(E).\n6. ALL WIRES SHALL BE PROVIDED WITH\nSTRAIN RELIEF AT ALL ENTRY INTO BOXES\nAS REQUIRED BY UL LISTING.\n7. MODULE FRAMES SHALL BE GROUNDED\nAT THE UL-LISTED LOCATION PROVIDED\nBY THE MANUFACTURER USING UL LISTED\nGROUNDING HARDWARE.\n8. ALL EXPOSED METAL PARTS (MODULE\nFRAMES, RAIL, BOXES, ETC.) SHALL BE\nGROUNDED USING UL LISTED LAY-IN LUGS\nLISTED FOR THE PURPOSE. POSTS SHALL\nBE MADE ELECTRICALLY CONTINUOUS\nWITH ATTACHED RAIL.\n9. MODULE FRAMES, RAIL, AND POSTS\nSHALL BE BONDED WITH EQUIPMENT\nGROUND CONDUCTORS AND GROUNDED\nAT THE MAIN ELECTRIC PANEL.\n10. THE DC GROUNDING ELECTRODE\nCONDUCTOR SHALL BE SIZED\nACCORDING TO ART. 250.166(B) & 690.47.",
